"pronto!"

--------CÓDIGO------------

    a = 80
    b = 50
    c = 10
    if a < b:
        print "comando 1"
    else:
        if a < c:
            print "comando 2"
        else:
            if b < c:
                print "comando 3"
            print "pronto!"

